import './customers.css'
import {FiUser} from 'react-icons/fi'
import Title from '../../components/Title'
import Header from '../../components/Header'





export default function Customers() {
    // States PF- pessoa Fisica
    const [nomeCli_Pf,setNomeCli_Pf] = useState('')
    const [telCli_Pf,setTelCli_Pf] = useState('')
    const [enderecoCli_Pf, setEnderecoCli_Pf] = useState( '' )
    // Pessoa Juridica - CNPJ
    const [nomeFantasia,setNomeFantasia] = useState('')
    const [cnpj,setCpnj] = useState('')
    const [endereco,setEndereco] = useState('')
    return (
        <div>
            <Header/>

            <div className='content'>
                <Title name='Clientes'>
                    <FiUser size={25}/>
                </Title>

                <div className='container'>
                    <form className='form-profile customers'>
                        <label>
                            Pessoal Física - RG
                        </label><br/>
                        <label>Nome</label>
                        <input type='text' value={nomeCli_Pf} onChange={(e)=> setNomeCli_Pf(e.target.value) }/>

                        <label>Telefone</label>
                        <input type='text' value={telCli_Pf} onChange={(e)=> setTelCli_Pf(e.target.value) }/>

                        <label>Endereço</label>
                        <input type='text' value={enderecoCli_Pf} onChange={( e ) => setEnderecoCli_Pf( e.target.value )} />

                        <label>
                            Pessoal Juridica - CNPJ
                        </label><br/>
                    </form>
                </div>
            </div>
        </div>
    );
}
